"use strict";

function _classCallCheck(instance, Constructor) { if (!(instance instanceof Constructor)) { throw new TypeError("Cannot call a class as a function"); } }

// Soldier
var Soldier = function Soldier() {
  _classCallCheck(this, Soldier);
}; // Viking


var Viking = function Viking() {
  _classCallCheck(this, Viking);
}; // Saxon


var Saxon = function Saxon() {
  _classCallCheck(this, Saxon);
}; // War


var War = function War() {
  _classCallCheck(this, War);
};